import React from 'react';
import Avatar from '../../assets/img/avatar.jpg'

function About() {
    return (
        <article className='about-contain'>
            <img src={Avatar} className="avatar" alt="Hank Mamallian Snoopicus the Beagle, the codeclast mascot" />
            <div className='textbox'>
                <h3>This is HMS Beagle, our Mascot.</h3>
                Like us, Snoop is a pragmatic idealist who thinks that the world can change, but only if we are willing to do the work.<br></br><br></br>
                The advent of blockchain technologies and W3 ideas bring promises of new paradigms in tech, engineering, design and human interaction, but the quality of these new paradigms will depend dearly on the honesty and integrity of those of us who write the technologies at the outset. We intend to bring the sort of integrity and diligence that will inform a better a better world to come.<br></br><br></br>
                To this end, we have three main tenets with which we make our work: We believe in free and equal speech - that free speech is only truly free when every person has the freedom to speak their truth from an equal level of power (meaning that freedom of speech has to take into account the inherent inequities in society and compensate for them). We believe that power corrupts everyone, and that the only way to fight that is to dilute power through equal and competitive systems that keep each other in check. Finally, we believe that it is our responsability to leave the world better than we found it, environmentally, socially and technologically.<br></br><br></br>
            </div>
        </article>
    )
};

export default About;
